import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
import { Helmet } from 'react-helmet';
import Header from '../components/header';
import './voting.css';

const Voting = (props) => {
  const { gameId } = useParams();
  const [players, setPlayers] = useState([]);
  const [votes, setVotes] = useState({
    opinionLeader: '',
    ideaAuthor: '',
    futurePresident: '',
    topCommunicators: [],
    topHeroes: [],
  });

  useEffect(() => {
    const fetchPlayers = async () => {
      try {
        const response = await axios.get(`http://localhost:8080/api/players?gameId=${gameId}`);
        setPlayers(response.data);
      } catch (err) {
        console.error('Error fetching players:', err);
      }
    };
    fetchPlayers();
  }, [gameId]);

  const handleVoteChange = (e) => {
    const { name, value } = e.target;
    setVotes((prevVotes) => ({
      ...prevVotes,
      [name]: value,
    }));
  };

  const handleMultiVoteChange = (e, category) => {
    const { options } = e.target;
    const selectedValues = [];
    for (let i = 0, l = options.length; i < l; i++) {
      if (options[i].selected) {
        selectedValues.push(options[i].value);
      }
    }
    setVotes((prevVotes) => ({
      ...prevVotes,
      [category]: selectedValues,
    }));
  };

  const handleSubmit = async () => {
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        console.log("You are not authorized");
        return;
      }
      await axios.post('http://localhost:8080/api/vote', votes, {
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      });
      alert('Vote submitted successfully');
    } catch (err) {
      console.error('Error submitting vote:', err);
    }
  };

  return (
    <div className="voting-container">
      <Helmet>
        <title>Voting - Outstanding Old Bison</title>
        <meta property="og:title" content="Voting - Outstanding Old Bison" />
      </Helmet>
      <Header rootClassName="header-root-class-name"></Header>
      <h1 className="voting-text">Голосование</h1>

      <div className="voting-dropdown">
        <label htmlFor="opinionLeader">Лидер общественного мнения</label>
        <select name="opinionLeader" onChange={handleVoteChange}>
          {players.map(player => (
            <option key={player.id} value={player.id}>{player.username}</option>
          ))}
        </select>
      </div>

      <div className="voting-dropdown">
        <label htmlFor="ideaAuthor">Автор ключевых идей</label>
        <select name="ideaAuthor" onChange={handleVoteChange}>
          {players.map(player => (
            <option key={player.id} value={player.id}>{player.username}</option>
          ))}
        </select>
      </div>

      <div className="voting-dropdown">
        <label htmlFor="futurePresident">Достоин стать президентом</label>
        <select name="futurePresident" onChange={handleVoteChange}>
          {players.map(player => (
            <option key={player.id} value={player.id}>{player.username}</option>
          ))}
        </select>
      </div>

      <div className="voting-dropdown">
        <label htmlFor="topCommunicators">Топ 3 коммуникативных навыков</label>
        <select name="topCommunicators" multiple onChange={(e) => handleMultiVoteChange(e, 'topCommunicators')}>
          {players.map(player => (
            <option key={player.id} value={player.id}>{player.username}</option>
          ))}
        </select>
      </div>

      <div className="voting-dropdown">
        <label htmlFor="topHeroes">Топ 3 положительных героев</label>
        <select name="topHeroes" multiple onChange={(e) => handleMultiVoteChange(e, 'topHeroes')}>
          {players.map(player => (
            <option key={player.id} value={player.id}>{player.username}</option>
          ))}
        </select>
      </div>

      <button type="button" onClick={handleSubmit}>Submit Vote</button>
    </div>
  );
};

export default Voting;
